declare const SQL_QUERY = "\nINSERT INTO Election (\n  \"id\", \"electionDate\", \"name\", \"type\", \"turf\"\n) VALUES (\n  @id, @electionDate, @name, @type, @turf\n)\nON CONFLICT (\"id\") DO UPDATE SET\n\"electionDate\" = IFNULL(@electionDate, \"electionDate\"), \"name\" = IFNULL(@name, \"name\"), \"type\" = IFNULL(@type, \"type\"), \"turf\" = IFNULL(@turf, \"turf\")\n";
export default SQL_QUERY;
